import React, { useState, useRef } from "react";

import Avatar1 from "../pages/assets/amanda-jones-e3jKBZoRnTs-unsplash.jpg";
import Avatar2 from "../pages/assets/chooseyou_img_1a.png";
import Avatar3 from "../pages/assets/fatih-kgqu_qs3B78-unsplash.jpg";
import Avatar4 from "../pages/assets/jene-stephaniuk--MCrF6hnojU-unsplash.jpg";
import Avatar5 from "../pages/assets/katrina-wright-yMg_SMqfoRU-unsplash.jpg";
import Avatar6 from "../pages/assets/khadeeja-yasser-FHT0KEOwtyg-unsplash.jpg";
import Avatar7 from "../pages/assets/chooseyou_img_2.png";
import Avatar8 from "../pages/assets/doing_my_best.jpg";
import { ReactComponent as Logo } from "./assets/chooseyou-mission-img.svg";
import classes from "./Home.module.css";
// import PageContent from "../components/PageContent";

function HomePage() {
  const scroll = useRef;
  const [showAboutModal, setShowAboutModal] = useState(false);
  const modalSetting = () => {
    setShowAboutModal(!showAboutModal);
    if (showAboutModal == false) {
      removeOverlay();
    } else {
      showOverlay();
    }
  };

  let overlayShown = false;
  let scrollPosition = 0;

  function showOverlay() {
    scrollPosition = window.scrollY;
    console.log(scrollPosition);
    const mainEl = document.querySelector("#body");
    console.log(mainEl);
    window.scrollTo({ top: -scrollPosition, behavior: "smooth" });

    // mainEl.style.scrollTop = -scrollPosition + "px";
    // document.body.classList.add("show-overlay");
  }

  function removeOverlay() {
    scrollPosition = window.scrollY;

    console.log(scrollPosition);

    // document.body.classList.remove("show-overlay");
    // window.scrollTo(0, scrollPosition);
    const mainEl = document.querySelector("#body");
    console.log(mainEl);
    window.scrollTo({ top: -scrollPosition, behavior: "smooth" });

    // mainEl.style.top = 0;
  }
  return (
    <>
      {showAboutModal && (
        <>
          <div className={classes.aboutMeModalMainBackdropContainer}>
            <div
              className={classes.aboutMeModalMainBackdrop}
              onClick={modalSetting}
            ></div>
            <div className={classes.aboutMeModalMain}>
              <div className={classes.aboutMeModalHeader}>About Me</div>
              <div className={classes.aboutMeModalBody}>
                <div
                  className={`${classes.aboutMeModalP} ${classes.aboutMeModalP1}`}
                >
                  For the past 10 years, I have been in the corporate yoga space
                  where I dedicated myself to developing leaders. As a kid and
                  young adult, I felt like I was never good enough. In my career
                  with yoga, I knew I wanted to make each individual I
                  interacted with knowing they were 1000% enough. When you make
                  space for people that way, they are more likely to multiply
                  that same energy into the world.
                </div>
                <div
                  className={`${classes.aboutMeModalP} ${classes.aboutMeModalP2}`}
                >
                  I used to be a professional dancer and I was constantly being
                  judged. I had challenges with family relationships, and one
                  day I moved across the country to figure out who I truly was
                  and what my purpose was in life. Yoga found me, I found yoga,
                  and the connection between breath, movement, and heart
                  unlocked something inside me I wanted to share with the world.
                  Since then I married the love of my life and high school
                  sweetheart. We are blessed with a fierce and confident 2 year
                  old daughter, and another baby on the way. I left the
                  corporate yoga space and after my daughter was born I was so
                  fulfilled taking the role of “mom”. When my daughter was about
                  4 months old, I remember watching one of my all-time favorite
                  television shows “Parenthood” and had this feeling of how do I
                  continue to choose me? I was in the routine of being a wife,
                  mom, daughter, and sister, and I was still missing something.
                  I started looking at master's degrees in psychology and
                  coaching programs. It came down to coaching because asking
                  questions and identifying people's strengths has always been
                  something I have loved. After a 105-degree sweaty and
                  inspirational yoga class, I was the teacher waiting for
                  students to ask them questions about the lessons they wanted
                  to take off the yoga mat. So 5 months into motherhood I said
                  yes to a 9 month coach training program!
                </div>
                <div
                  className={`${classes.aboutMeModalP} ${classes.aboutMeModalP3}`}
                >
                  I always thought I would be the CEO of a corporation and
                  become a mom with a large family. Can I say this happened?
                  Sort of! It’s a work in progress, and I drive this dream. I
                  founded this coaching business, and adore being a mom. Seeing
                  my daughter explore daily has opened a side of me that reminds
